import "./App.css";
import SongSearch from "./components/SongSearch";

function App() {
  return (
    <div className="flex flex-col place-items-center min-h-screen bg-zinc-900 overflow-auto">
      <h1 className="text-3xl font-bold underline">
        Drizzle
      </h1>
      <div style={{ marginTop: "-15%" }}>
        <SongSearch />
      </div>
    </div>
  );
}

export default App;
